расчет нормативов допустимых выбросов загрязняющих веществ в атмосферный воздух;
расчет нормативов допустимых сбросов загрязняющих веществ в водные объекты;
утвержденные квоты выбросов (в случае установления таких квот в период проведения эксперимента по квотированию выбросов загрязняющих веществ в атмосферный воздух с 1 января 2020 г. по 31 декабря 2026 г.) в соответствии с частью 7 статьи 5 Федерального закона от 26 июля 2019 г. № 195-ФЗ "О проведении эксперимента по квотированию выбросов загрязняющих веществ и внесении изменений в отдельные законодательные акты Российской Федерации в части снижения загрязнения атмосферного воздуха".

